import{_ as e,c as t,o as s,a as o}from"./app.7410f5df.js";var a="/cubepress/toolbar.png",r="/cubepress/menubar.png",i="/cubepress/searchiccid.png",l="/cubepress/sortusage.png",n="/cubepress/3cards.png";const v=JSON.parse('{"title":"\u{1F4F6} SIMs","description":"","frontmatter":{},"headers":[{"level":2,"title":"Table Toolbar \u2699\uFE0F","slug":"table-toolbar-\u2699\uFE0F"},{"level":2,"title":"Table Menu Bar \u26A1\uFE0F","slug":"table-menu-bar-\u26A1\uFE0F"},{"level":2,"title":"SIM List \u{1F522}","slug":"sim-list-\u{1F522}"},{"level":2,"title":"SIM Collpasible Detail \u{1F53D}","slug":"sim-collpasible-detail-\u{1F53D}"},{"level":3,"title":"Basic Info Card","slug":"basic-info-card"},{"level":3,"title":"Connection Card","slug":"connection-card"},{"level":3,"title":"Service Card","slug":"service-card"}],"relativePath":"guide/checksim.md","lastUpdated":1671516211000}'),c={name:"guide/checksim.md"},d=o('<h1 id="\u{1F4F6}-sims" tabindex="-1">\u{1F4F6} SIMs <a class="header-anchor" href="#\u{1F4F6}-sims" aria-hidden="true">#</a></h1><p>You may check the basic information of the SIMs from SIM menu in the sidebar, and we offer enriched features above and beyond.</p><h2 id="table-toolbar-\u2699\uFE0F" tabindex="-1">Table Toolbar \u2699\uFE0F <a class="header-anchor" href="#table-toolbar-\u2699\uFE0F" aria-hidden="true">#</a></h2><blockquote><p>Configuration of the table</p></blockquote><p><img src="'+a+'" alt="toolbar"></p><ul><li><strong>Height Setting</strong> for table rows: <em>default, medium or compact.</em></li><li><strong>Column Setting</strong> to check only the columns you&#39;d like to see</li><li><strong>Refresh Table Data</strong> clear all the filters and pull the latest data</li><li><strong>Global Search Bar</strong> to search by ICCID/IMEI/MSISDN</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Quickly find the SIM by entering <strong>partial ending digits</strong> in global search bar. Searching will happen in order of <code>ICCID</code>, <code>IMEI</code> then <code>MSISDN</code> and return all the matched results.</p><p>E.g.: <code>023801</code>=&gt;</p><ul><li>record 1: ICCID <code>89013113804763023801</code>,</li><li>record 2: ICCID <code>89013113804763079976</code>, IMEI <code>230A8X023801</code></li></ul><p>You could also search for <strong>multiple SIMs</strong> at one time by seperating the number with &#39;,&#39;</p><p>E.g.: <code>023801, 8802</code> =&gt;</p><ul><li>record 1: ICCID <code>89013113804763023801</code></li><li>record 2: ICCID <code>89013113804763948802</code></li></ul></div><hr><h2 id="table-menu-bar-\u26A1\uFE0F" tabindex="-1">Table Menu Bar \u26A1\uFE0F <a class="header-anchor" href="#table-menu-bar-\u26A1\uFE0F" aria-hidden="true">#</a></h2><blockquote><p>Actions present in menu bar allow users to perform quick bulk actions on selected SIMs (1 or more).</p></blockquote><p><img src="'+r+'" alt="menubar"></p><ul><li><p>\u2193 \uFF1AExport the selected SIMs or all SIMs into excel file</p><ul><li>Selected SIMs: checked SIMs from current page and other pages</li><li>All SIMs: all the SIMs in the current table of all pages</li></ul></li><li><p>Edit tags</p></li><li><p>Edit notes</p></li><li><p>Send SMS to the selected SIM</p></li><li><p>Edit device name</p></li><li><p>Transfer SIMs</p></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Edit tags or notes in bulk will <strong>override</strong> the existing tags/notes.</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p><strong>Transfer SIMs</strong> For more information on how to transfer SIMs between organisations, please check: <a href="/cubepress/sim/transfer.html">Transfer SIM How-to</a></p></div><hr><h2 id="sim-list-\u{1F522}" tabindex="-1">SIM List \u{1F522} <a class="header-anchor" href="#sim-list-\u{1F522}" aria-hidden="true">#</a></h2><p>Data columns of the SIM List are:</p><table><thead><tr><th>Columns</th><th>Description</th><th>Remarks</th></tr></thead><tbody><tr><td><strong>Tags</strong></td><td>Customizable tags for SIMs.Tags can be used to filter and group SIMs.</td><td>Max. 5 tags per SIM and max. 10 characters per tag</td></tr><tr><td><strong>Name</strong></td><td>Device name for SIMs.</td><td>Max. 40 characters</td></tr><tr><td><strong>ICCID</strong></td><td>The unique <strong>I</strong>ntegrated <strong>C</strong>ircuit <strong>C</strong>ard <strong>Id</strong>entification Number of the SIM by global standards.</td><td></td></tr><tr><td><strong>MSISDN</strong></td><td><strong>M</strong>obile <strong>S</strong>tation <strong>I</strong>ntegrated <strong>S</strong>ervices <strong>D</strong>igital <strong>N</strong>etwork is a unique number that can be useful in calls or sms service.</td><td></td></tr><tr><td><strong>Status</strong></td><td>It indicates the current life cycle stage of the SIM.</td><td>refer to <a href="/cubepress/guide/simstatus.html">SIM status</a> for more details.</td></tr><tr><td><strong>Cycle Usage</strong></td><td>Data usage of the current service cycle</td><td>day, month or year</td></tr><tr><td><strong>Limit</strong></td><td>Data limit of the current service cycle</td><td>day, month or year</td></tr></tbody></table><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>You can also quick search a SIM by simply <strong>entering its ending digits</strong> in the ICCID or MSISDN column search bar.</p><p><strong>Multi-search mode</strong> is supported here too.</p><p><img src="'+i+'" alt="search imei"></p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Quickly find out the top-10 data usage SIMs by sorting <code>Usage</code> column; And the usage will be painted in alerting red once it exceeds the limit, in order to raise awareness.</p><p><img src="'+l+'" alt="sort usage"></p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Hit <code>Refresh</code> icon button \u{1F504} in the tool bar to clear all the column <strong>search, sorting and searching</strong> citeria.</p></div><h2 id="sim-collpasible-detail-\u{1F53D}" tabindex="-1">SIM Collpasible Detail \u{1F53D} <a class="header-anchor" href="#sim-collpasible-detail-\u{1F53D}" aria-hidden="true">#</a></h2><p>You may press \u25B6 to expand more SIM detail. There are 3 cards:</p><ul><li><strong>Basic</strong></li><li><strong>Connection</strong></li><li><strong>Service</strong></li></ul><p><img src="'+n+'" alt="3cards"></p><h3 id="basic-info-card" tabindex="-1">Basic Info Card <a class="header-anchor" href="#basic-info-card" aria-hidden="true">#</a></h3><p>Basic information of a SIM.</p><div class="info custom-block"><p class="custom-block-title">Go to</p><p><a href="./simbasic.html">SIM - Basic</a></p></div><h3 id="connection-card" tabindex="-1">Connection Card <a class="header-anchor" href="#connection-card" aria-hidden="true">#</a></h3><p>In connection section, you can see a consolidated information of SIM&#39;s most current status of connection, the last connected time and place, and we even offer diagnositics in the event of disconnection.</p><div class="info custom-block"><p class="custom-block-title">Go to</p><p><a href="./simconnection.html">SIM - Connection</a></p></div><h3 id="service-card" tabindex="-1">Service Card <a class="header-anchor" href="#service-card" aria-hidden="true">#</a></h3><p>Services available with the SIM.</p><div class="info custom-block"><p class="custom-block-title">Go to</p><p><a href="./simservice.html">SIM - Service</a></p></div>',34),p=[d];function h(u,g,m,b,I,f){return s(),t("div",null,p)}var M=e(c,[["render",h]]);export{v as __pageData,M as default};
